_14:"precision mediump float;\n#define LOWPREC lowp\n// Uniforms look like they're shared between vertex and fragment shaders in GLSL, so we have to be careful to avoid name clashes\n\nuniform sampler2D gm_BaseTexture;\n\nuniform bool gm_PS_FogEnabled;\nuniform vec4 gm_FogColour;\nuniform bool gm_AlphaTestEnabled;\nuniform float gm_AlphaRefValue;\n\nvoid DoAlphaTest(vec4 SrcColour)\n{\n	if (gm_AlphaTestEnabled)\n	{\n		if (SrcColour.a <= gm_AlphaRefValue)\n		{\n			discard;\n		}\n	}\n}\n\nvoid DoFog(inout vec4 SrcColour, float fogval)\n{\n	if (gm_PS_FogEnabled)\n	{\n		SrcColour = mix(SrcColour, gm_FogColour, clamp(fogval, 0.0, 1.0)); \n	}\n}\n\n#define _YY_GLSLES_ 1\n//\n// Simple passthrough fragment shader\n//\nvarying vec2 v_vTexcoord;\nvarying vec2 v_vNormalizedTexcoord;\nvarying float v_fProgress;\n//varying vec4 v_vColour;\n\n// GLSL ES: cannot use uniform here?\n//uniform vec4 u_SpriteUVs;\n//uniform float u_Progress;\n\nvoid main()\n{\n	float prog_line = smoothstep(v_fProgress-0.05,v_fProgress,v_vNormalizedTexcoord.y) \n					- smoothstep(v_fProgress,v_fProgress+0.05,v_vNormalizedTexcoord.y);\n	float prog_step = step(v_fProgress, v_vNormalizedTexcoord.y);\n	vec4 tex_color = texture2D( gm_BaseTexture, v_vTexcoord );\n	vec4 gray_color = vec4(vec3(dot(tex_color.rgb, vec3(0.3, 0.59, 0.11))),tex_color.a) * (1.-prog_step);\n	tex_color *= prog_step;\n	gl_FragColor = gray_color + tex_color + vec4(prog_line) * step(0.01, v_fProgress);\n}\n",
